import React from 'react';
import Bheem from './components/Bheem';
import Counter from './components/counter'

const [initalState, setState] = React.useState(0);

function Increment(){
  setState((oldValue)=>{
    return oldValue+1;
  })
}

function Decrement(){
  setState((oldValue)=>{
    return oldValue-1;
  })
}

function App() {
  return (
    <div>
      <Bheem />
      <Counter incre={Increment} decre={Decrement}/>
    </div>
  );
}

export default App;
